import './index.css';
import getDropDownOptions from './getDropDownOptions';

function SmChartThree() {

    const url = 'https://restcountries.eu/rest/v2/all';
    getDropDownOptions(url);
  return (
    <section class="grid-container charts3">
        <div class="grid-item chart3">Chart Three</div>
        <div id="chartThreeDropdown"></div>
    </section>
  );
}

export default SmChartThree;
